/**title:获取页面图片**/console.log("\n %c OneKeyJsTools %c @Sogrey \n\n","color: #fadfa3; background: #030307; padding:5px 0;","background: #fadfa3; padding:5px 0;");String.prototype.endWith=function(t){var e=this.length-t.length;return 0<=e&&this.lastIndexOf(t)==e};var isImage=function(t){return t&&t.src&&(t.src.endsWith(".jpg")||t.src.endsWith(".jpeg")||t.src.endsWith(".png"))},result=Object.values(document.getElementsByTagName("img")).filter(isImage).map(t=>{return{src:t.getAttribute("data-original"),title:t.title}});console.log(result);